pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";

contract Captchain is Ownable {

    event CaptchaAttempt(address _user, bool _success);

    string private name;

    string private result; // Shared variable (possibly could be map)

    constructor(string memory _name) {
        name = _name;
    }

    function attempt() public returns(string memory) {

        bool correct = true; // TODO: implement API call check.
        if (!correct) {
            // Log the failure and raise an exception.
            emit CaptchaAttempt(msg.sender, false);
            require(correct, "Incorrect");
        }
        // Successful scenario (no exception).
        emit CaptchaAttempt(msg.sender, true);

    }

}

